values:
Not a whole lot going on; I have a subway sandwich sitting right in front of me (yum!).&nbsp;
That comic with Naruto and Sasuke got a lot of attention on MyOtaku.com (I'm not loved at dA! Wyuuuh!). Out of the 70 comments, there were only 3 negative comments. I'm just glad it got a really good response (and the ones who flamed, I don't really care; I just laughed). I didn't say anything to them because since I had the right to express myself with the comic, they had a right to comment.&nbsp;

Oh well :P at least I'm not being emo and taking a positive outlook on things ( still got church in my head from this morning; that's good).&nbsp;

I've got a bunch of comic ideas in my head; the biggest one involves me, Wyatt, Khalid and Becca (won't say though ;P).&nbsp; I also have a photoshop piece I want to finish with one of my original characters. But I don't have time; I didn't get off of work last night until around 3 (didn't get home til 3:30...). And I have to work in 3 hours...
( I have tomorrow off!!! Though I'm probably spending it with Wyatt!...)

Yep yep yep... I'm not doing that Rising Stars of Manga (urgh!). There's just too little time and I'm not ready to go pro yet; especially if I have a hard time fleshing ideas out on paper. Though Wes Wyatt and I are doing the "blackout manga.
The first page with have a scene of a guy who is surrounded by a whole bunch of thugs, and gets into a fight. Very detailed; unti about the second page the guy is hit and blackouts. The ENTIRE manga then has black panels; to signify that he has blacked out; though the panels are formed to where it looks like something's going on. Then on the last page, he wakes up and says, "Oh, I blacked out." We're only sending this in for ROFLs and LMAOs. (lol)
We're sending it in under a false name, too. I wanted to use Wes Lee Roth but Wes doesn't... that commie...

I actually started scripting my manga; though it was at work (lol). Hey, at least I'm getting somewhere now.&nbsp;It's&nbsp;only a page long on a 3"x5" but&nbsp;applied to manga pages I should have about... 3 pages. W00T. I feel that it's really fast paced so far (I feel that the whole thing is going to be fast paced and rushed). It's a comedy/drama... not so much drama though...
I've been drawing a lot more; I went on a frenzy around 5 a.m. yesterday. I updated them on deviantart but they're scraps; except my Emily one (which I'm actually rather fond of; I hope&nbsp;it was alright to&nbsp;post on the&nbsp;Dramacon community website). I can't stay up too late; I&nbsp;have church (and there's no way I'm pulling an allnighter; especially with daylight savings time). Then I get to work tomorrow (but I'm&nbsp;off on Monday!).&nbsp;
Hopefully I&nbsp;can get stuff done. Heh.&nbsp;



And I'm back on Myspace... only for networking though. Thought that once i get my comic done I can promote it there; with all it's popularity... something tells me I'll regret it though... *wyuuh*
